import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-dashboard',
  templateUrl: './dashboard.component.html',
  styleUrls: ['./dashboard.component.css']
})
export class DashboardComponent {


}
<ul>
    <li><a routerLink="/course-registration" routerLinkActive="active" ariaCurrentWhenActive="page">Course Registration</a></li>
    <li><a routerLink="/course-view" routerLinkActive="active" ariaCurrentWhenActive="page">View Courses</a></li>
</ul>
    <router-outlet></router-outlet>
